import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './SalaryTable.css';

const SalaryTable = ({ contractId, month, year }) => {
  const [salaries, setSalaries] = useState([]);
  const [totals, setTotals] = useState({
    attendance: 0,
    dailyWage: 0,
    grossSalary: 0,
    employeeEPF: 0,
    employeeESIC: 0,
    pTax: 0,
    totalDeductions: 0,
    netSalary: 0,
    employerEPF: 0,
    employerESIC: 0,
    adminCharges: 0,
    contribution: 0,
  });

  useEffect(() => {
    const fetchSalaries = async () => {
      try {
        const response = await axios.get(`http://localhost:5000/api/contracts/${contractId}/salaries`, {
          params: { month, year },
        });
        setSalaries(response.data);
        calculateTotals(response.data);
      } catch (error) {
        console.error('Error fetching salaries:', error);
      }
    };

    const calculateTotals = (salaries) => {
      const totals = salaries.reduce((acc, salary) => {
        acc.attendance += salary.attendance;
        acc.dailyWage += salary.dailyWage;
        acc.grossSalary += salary.grossSalary;
        acc.employeeEPF += salary.employeeEPF;
        acc.employeeESIC += salary.employeeESIC;
        acc.pTax += salary.pTax;
        acc.totalDeductions += salary.totalDeductions;
        acc.netSalary += salary.netSalary;
        acc.employerEPF += salary.employerEPF;
        acc.employerESIC += salary.employerESIC;
        acc.adminCharges += salary.adminCharges;
        acc.contribution += salary.contribution;
        return acc;
      }, {
        attendance: 0,
        dailyWage: 0,
        grossSalary: 0,
        employeeEPF: 0,
        employeeESIC: 0,
        pTax: 0,
        totalDeductions: 0,
        netSalary: 0,
        employerEPF: 0,
        employerESIC: 0,
        adminCharges: 0,
        contribution: 0,
      });
      setTotals(totals);
    };

    fetchSalaries();
  }, [contractId, month, year]);

  return (
    <div className="salary-table">
      <h2>Salary Details</h2>
      <table>
        <thead>
          <tr>
            <th>Employee Name</th>
            <th>Attendance</th>
            <th>Daily Wage</th>
            <th>Gross Salary</th>
            <th>Employee EPF</th>
            <th>Employee ESIC</th>
            <th>P Tax</th>
            <th>Total Deductions</th>
            <th>Net Salary</th>
            <th>Employer EPF</th>
            <th>Employer ESIC</th>
            <th>Admin Charges</th>
            <th>Contribution</th>
          </tr>
        </thead>
        <tbody>
          {salaries.map((salary) => (
            <tr key={salary.employeeId._id}>
              <td>{salary.employeeId.name}</td>
              <td>{salary.attendance}</td>
              <td>{salary.dailyWage}</td>
              <td>{salary.grossSalary}</td>
              <td>{salary.employeeEPF}</td>
              <td>{salary.employeeESIC}</td>
              <td>{salary.pTax}</td>
              <td>{salary.totalDeductions}</td>
              <td>{salary.netSalary}</td>
              <td>{salary.employerEPF}</td>
              <td>{salary.employerESIC}</td>
              <td>{salary.adminCharges}</td>
              <td>{salary.contribution}</td>
            </tr>
          ))}
          <tr>
            <td>Totals</td>
            <td>{totals.attendance.toFixed(2)}</td>
            <td>{totals.dailyWage.toFixed(2)}</td>
            <td>{totals.grossSalary.toFixed(2)}</td>
            <td>{totals.employeeEPF.toFixed(2)}</td>
            <td>{totals.employeeESIC.toFixed(2)}</td>
            <td>{totals.pTax.toFixed(2)}</td>
            <td>{totals.totalDeductions.toFixed(2)}</td>
            <td>{totals.netSalary.toFixed(2)}</td>
            <td>{totals.employerEPF.toFixed(2)}</td>
            <td>{totals.employerESIC.toFixed(2)}</td>
            <td>{totals.adminCharges.toFixed(2)}</td>
            <td>{totals.contribution.toFixed(2)}</td>
          </tr>
        </tbody>
      </table>
    </div>
  );
};

export default SalaryTable;
